--
-- Name: calcular_nivel_confianza(numeric, numeric, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.calcular_nivel_confianza(p_desviacion numeric, p_promedio numeric, p_meses_datos integer DEFAULT 3) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_coeficiente_variacion NUMERIC;
    v_nivel_confianza NUMERIC;
    v_penalizacion_datos NUMERIC;
BEGIN
    -- Si no hay datos suficientes, retornar baja confianza
    IF p_promedio = 0 OR p_promedio IS NULL THEN
        RETURN 0.50;
    END IF;

    -- Calcular coeficiente de variación (CV = desviación / promedio)
    v_coeficiente_variacion := (p_desviacion / NULLIF(p_promedio, 0)) * 100;

    -- Determinar nivel de confianza base según CV
    IF v_coeficiente_variacion <= 10 THEN
        v_nivel_confianza := 0.95; -- Muy estable
    ELSIF v_coeficiente_variacion <= 20 THEN
        v_nivel_confianza := 0.90; -- Estable
    ELSIF v_coeficiente_variacion <= 30 THEN
        v_nivel_confianza := 0.85; -- Moderado
    ELSIF v_coeficiente_variacion <= 50 THEN
        v_nivel_confianza := 0.75; -- Variable
    ELSE
        v_nivel_confianza := 0.65; -- Muy variable
    END IF;

    -- Aplicar penalización por pocos datos
    IF p_meses_datos = 1 THEN
        v_penalizacion_datos := 0.15; -- Penalizar 15% con solo 1 mes
    ELSIF p_meses_datos = 2 THEN
        v_penalizacion_datos := 0.05; -- Penalizar 5% con solo 2 meses
    ELSE
        v_penalizacion_datos := 0; -- Sin penalización con 3+ meses
    END IF;

    v_nivel_confianza := v_nivel_confianza - v_penalizacion_datos;

    -- Asegurar que esté entre 0.50 y 0.95
    v_nivel_confianza := GREATEST(0.50, LEAST(0.95, v_nivel_confianza));

    RETURN v_nivel_confianza;
END;
$$;


ALTER FUNCTION public.calcular_nivel_confianza(p_desviacion numeric, p_promedio numeric, p_meses_datos integer) OWNER TO postgres;

--
-- Name: calcular_pmp_consumo_insumo(uuid, date, date); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.calcular_pmp_consumo_insumo(p_insumo_id uuid, p_fecha_inicio date, p_fecha_fin date) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_fecha_ref DATE := (
        SELECT COALESCE(MAX(fecha_movimiento)::DATE, CURRENT_DATE)
        FROM movimientos_inventario
    );
    v_consumos NUMERIC[];
    v_pesos NUMERIC[];
    v_pmp NUMERIC := 0;
    v_consumo_mes NUMERIC;
    v_mes_actual DATE;
    i INT;
    v_total_meses INT := 0;
BEGIN
    -- Calcular últimos 3 meses de consumo
    FOR i IN 1..3 LOOP
        v_mes_actual := DATE_TRUNC('month', v_fecha_ref) - (i || ' month')::INTERVAL;

        -- Calcular consumo total del mes (salidas de inventario)
        SELECT COALESCE(SUM(ABS(mi.cantidad)), 0)
        INTO v_consumo_mes
        FROM movimientos_inventario mi
        INNER JOIN lotes_insumos li ON mi.lote_id = li.id
        WHERE li.insumo_id = p_insumo_id
          AND lower(mi.tipo) IN ('salida', 'consumo', 'ajuste_salida')
          AND mi.fecha_movimiento >= DATE_TRUNC('month', v_mes_actual)
          AND mi.fecha_movimiento < DATE_TRUNC('month', v_mes_actual) + INTERVAL '1 month';

        -- Solo agregar si hay consumo
        IF v_consumo_mes > 0 THEN
            v_consumos := array_append(v_consumos, v_consumo_mes);
            v_total_meses := v_total_meses + 1;
        END IF;
    END LOOP;

    -- Si no hay datos, retornar 0
    IF v_total_meses = 0 THEN
        RETURN 0;
    END IF;

    -- Ajustar pesos según cantidad de datos disponibles
    IF v_total_meses = 1 THEN
        v_pesos := ARRAY[1.0]; -- 100% al único mes
    ELSIF v_total_meses = 2 THEN
        v_pesos := ARRAY[0.6, 0.4]; -- 60%, 40%
    ELSE
        v_pesos := ARRAY[0.5, 0.3, 0.2]; -- 50%, 30%, 20%
    END IF;

    -- Calcular promedio móvil ponderado
    FOR i IN 1..v_total_meses LOOP
        v_pmp := v_pmp + (v_consumos[i] * v_pesos[i]);
    END LOOP;

    RETURN v_pmp;
END;
$$;


ALTER FUNCTION public.calcular_pmp_consumo_insumo(p_insumo_id uuid, p_fecha_inicio date, p_fecha_fin date) OWNER TO postgres;

--
-- Name: calcular_pmp_ventas_producto(uuid, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.calcular_pmp_ventas_producto(p_producto_id uuid, p_meses_historia integer DEFAULT 3) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_ventas NUMERIC[];
    v_pesos NUMERIC[] := ARRAY[0.5, 0.3, 0.2];
    v_pmp NUMERIC := 0;
    v_mes_actual DATE;
    v_ventas_mes NUMERIC;
    i INTEGER;
BEGIN
    -- Obtener ventas de los últimos N meses
    FOR i IN 1..p_meses_historia LOOP
        v_mes_actual := date_trunc('month', CURRENT_DATE - (i || ' months')::INTERVAL)::DATE;

        -- Calcular total de ventas del producto en el mes
        SELECT COALESCE(SUM(dv.cantidad * dv.precio_unitario), 0)
        INTO v_ventas_mes
        FROM detalles_venta dv
        INNER JOIN ventas v ON dv.venta_id = v.id
        WHERE dv.producto_id = p_producto_id
          AND v.estado = 'Completada'
          AND date_trunc('month', v.fecha_venta) = v_mes_actual;

        v_ventas := array_append(v_ventas, v_ventas_mes);
    END LOOP;

    -- Calcular promedio ponderado
    FOR i IN 1..LEAST(array_length(v_ventas, 1), array_length(v_pesos, 1)) LOOP
        v_pmp := v_pmp + (v_ventas[i] * v_pesos[i]);
    END LOOP;

    RETURN ROUND(v_pmp, 2);
END;
$$;


ALTER FUNCTION public.calcular_pmp_ventas_producto(p_producto_id uuid, p_meses_historia integer) OWNER TO postgres;

--
-- Name: can_access_view(uuid, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.can_access_view(p_user_id uuid, p_vista_ruta text) RETURNS boolean
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  has_access boolean := false;
BEGIN
  -- Verificación rápida en una sola consulta
  SELECT EXISTS(
    SELECT 1
    FROM public.usuarios u
    JOIN public.roles_vistas_operaciones rvo ON u.rol_id = rvo.rol_id
    JOIN public.vistas v ON rvo.vista_id = v.id
    JOIN public.operaciones o ON rvo.operacion_id = o.id
    WHERE u.id = p_user_id
    AND u.estado = 'Activo'
    AND v.ruta = p_vista_ruta
    AND o.nombre = 'leer'
  ) INTO has_access;
  
  RETURN has_access;
END;
$$;


ALTER FUNCTION public.can_access_view(p_user_id uuid, p_vista_ruta text) OWNER TO postgres;

--
-- Name: fn_analizar_movimiento(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.fn_analizar_movimiento() RETURNS trigger
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
declare
  insumo_uuid uuid;
  current_qty numeric;
  avg_qty numeric;
  count_hist integer;
  limite numeric := 1.5; -- 50% por encima del promedio
  mensaje text;
  alerta_id uuid;
begin
  -- Solo procesar salidas (consumo). Ajusta si tu 'tipo' usa otra palabra.
  if (NEW.tipo is null) then
    raise notice 'movimiento sin tipo, ignorando';
    return NEW;
  end if;

  if lower(NEW.tipo) != 'salida' then
    return NEW;
  end if;

  -- obtener lote -> insumo
  select insumo_id into insumo_uuid from public.lotes_insumos where id = NEW.lote_id;

  if insumo_uuid is null then
    -- registrar inconsistencia
    values (NULL, 'ERROR_ANALISIS', 'No se pudo obtener insumo_id para lote_id: ' || NEW.lote_id);
    return NEW;
  end if;

  current_qty := NEW.cantidad;

  -- obtener historial de salidas (ej: últimos 90 días) y promedio
  select coalesce(sum(m.cantidad),0), count(*) into avg_qty, count_hist
  from public.movimientos_inventario m
  inner join public.lotes_insumos li on li.id = m.lote_id
  where m.tipo ilike 'salida' -- solo salidas
    and li.insumo_id = insumo_uuid
    and m.fecha_movimiento >= now() - interval '90 days';

  -- Si hay menos de 3 registros, no generar alerta (poca data)
  if count_hist < 3 then
    return NEW;
  end if;

  -- calcular promedio (avg_qty contiene sum; cuidemos dividir por count_hist)
  if count_hist > 0 then
    avg_qty := (avg_qty::numeric) / (count_hist::numeric);
  else
    avg_qty := 0;
  end if;

  -- comprobar datos corruptos o incompletos
  if current_qty is null or avg_qty is null then
    values (NULL, 'ERROR_ANALISIS', 'Datos incompletos al analizar movimiento ' || NEW.id);
    return NEW;
  end if;

  -- detectar anomalía
  if current_qty > (avg_qty * limite) then
    mensaje := format('Consumo anómalo detectado para insumo %s: actual= %s, promedio= %s', insumo_uuid::text, current_qty::text, avg_qty::text);

    values (gen_random_uuid(), insumo_uuid, NEW.id, 'consumo_anomalo', 'pendiente', mensaje, now())
    returning id into alerta_id;

    -- opcional: también insertar fila en alerts general
    values (null, 'NEW', current_qty, avg_qty, now());

    -- registrar log de creación (usa alert_logs que espera alert_id entero; si quieres enlazar usa otra tabla)
    -- aquí alert_logs.alert_id FK con alerts(id) — no hacemos join con alertas_consumo
    -- si quieres registrar relacion con alertas_consumo, crea otro log table; por ahora dejamos el registro en alert_logs con null.
    values (currval('alerts_id_seq')::integer, 'CREAR_ALERTA', mensaje);
  end if;

  return NEW;
exception
  when others then
    -- registrar error en alert_logs
    values (NULL, 'ERROR_FN_ANALIZAR', sqlerrm);
    return NEW;
end;
$$;


