--
-- Name: fn_check_stock_minimo(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.fn_check_stock_minimo() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_stock_minimo NUMERIC;
    v_nombre_insumo TEXT;
    v_alerta_existente INT;
BEGIN
    -- 1. Obtener datos del insumo
    SELECT stock_minimo, nombre INTO v_stock_minimo, v_nombre_insumo
    FROM public.insumos
    WHERE id = NEW.insumo_id;

    -- 2. Verificar si YA existe una alerta pendiente para este insumo
    -- Esto evita duplicados si el stock fluctúa o si hay varios lotes
    SELECT COUNT(*) INTO v_alerta_existente
    FROM public.alertas_consumo
    WHERE insumo_id = NEW.insumo_id 
    AND estado = 'pendiente'
    AND tipo_alerta = 'stock_bajo';

    -- 3. Lógica de disparo:
    -- Si el stock es bajo Y no hay una alerta pendiente ya abierta
    IF (NEW.cantidad_actual < v_stock_minimo) AND (v_alerta_existente = 0) THEN
       
        VALUES (
            NEW.insumo_id, 
            'stock_bajo', 
            'Alerta: El insumo ' || v_nombre_insumo || ' tiene stock crítico (' || NEW.cantidad_actual || ').',
            'pendiente',
            now()
        );
    END IF;

    RETURN NEW;
END;
$$;


