    LANGUAGE plpgsql
    AS $$
DECLARE
    v_eliminadas INTEGER;
BEGIN
    WITH deleted AS (
        DELETE FROM predicciones
        WHERE fecha_fin < CURRENT_DATE - INTERVAL '12 months'
        RETURNING *
    )
    SELECT COUNT(*) INTO v_eliminadas FROM deleted;

    RAISE NOTICE 'Predicciones antiguas eliminadas: %', v_eliminadas;
    RETURN v_eliminadas;
END;
$$;


