-- Name: obtener_metricas_precision(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.obtener_metricas_precision() RETURNS TABLE(tipo_prediccion text, total_predicciones bigint, predicciones_evaluadas bigint, desviacion_promedio numeric, desviacion_abs_promedio numeric, porcentaje_desviacion_promedio numeric, "precisión_porcentaje" numeric, nivel_confianza_promedio numeric)
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
BEGIN
    RETURN QUERY
    SELECT 
        p.tipo_prediccion::text,
        COUNT(*)::bigint,
        COUNT(*) FILTER (WHERE p.valor_real IS NOT NULL)::bigint,
        ROUND(AVG(p.desviacion)::numeric, 2),
        ROUND(AVG(ABS(p.desviacion))::numeric, 2),
        ROUND(AVG(p.porcentaje_desviacion)::numeric, 2),
        ROUND((100 - COALESCE(AVG(ABS(p.porcentaje_desviacion)), 0))::numeric, 1),
        ROUND(AVG(p.nivel_confianza)::numeric, 2)
    FROM public.predicciones p
    GROUP BY p.tipo_prediccion;
END;
$$;


