--
-- Name: obtener_top_insumos(integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.obtener_top_insumos(p_limite integer DEFAULT 10) RETURNS TABLE(insumo_id uuid, total_consumo numeric, meses_con_datos integer)
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_rows INT := 0;
    v_fecha_ref DATE := (
        SELECT COALESCE(MAX(mi.fecha_movimiento)::DATE, CURRENT_DATE)
        FROM movimientos_inventario mi
    );
BEGIN
    -- Intento 1: últimos 3 meses
    RETURN QUERY
    SELECT
        li.insumo_id,
        SUM(ABS(mi.cantidad)) as total_consumo,
        COUNT(DISTINCT DATE_TRUNC('month', mi.fecha_movimiento))::INT as meses_con_datos
    FROM movimientos_inventario mi
    INNER JOIN lotes_insumos li ON mi.lote_id = li.id
    WHERE lower(mi.tipo) IN ('salida', 'consumo', 'ajuste_salida')
      AND mi.fecha_movimiento >= v_fecha_ref - INTERVAL '3 months'
    GROUP BY li.insumo_id
    HAVING SUM(ABS(mi.cantidad)) > 0 -- Solo insumos con consumo
    ORDER BY total_consumo DESC
    LIMIT p_limite;

    GET DIAGNOSTICS v_rows = ROW_COUNT;

    -- Intento 2: si no hubo datos recientes, usa últimos 12 meses
    IF v_rows = 0 THEN
        RETURN QUERY
        SELECT
            li.insumo_id,
            SUM(ABS(mi.cantidad)) as total_consumo,
            COUNT(DISTINCT DATE_TRUNC('month', mi.fecha_movimiento))::INT as meses_con_datos
        FROM movimientos_inventario mi
        INNER JOIN lotes_insumos li ON mi.lote_id = li.id
        WHERE lower(mi.tipo) IN ('salida', 'consumo', 'ajuste_salida')
          AND mi.fecha_movimiento >= v_fecha_ref - INTERVAL '12 months'
        GROUP BY li.insumo_id
        HAVING SUM(ABS(mi.cantidad)) > 0
        ORDER BY total_consumo DESC
        LIMIT p_limite;
    END IF;
END;
$$;


ALTER FUNCTION public.obtener_top_insumos(p_limite integer) OWNER TO postgres;

--
-- Name: obtener_top_productos(integer, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.obtener_top_productos(p_limite integer DEFAULT 8, p_meses_historia integer DEFAULT 3) RETURNS TABLE(producto_id uuid, nombre text, total_vendido numeric)
    LANGUAGE plpgsql
    AS $$
BEGIN
    RETURN QUERY
    SELECT
        p.id,
        p.nombre,
        SUM(dv.cantidad * dv.precio_unitario) as total
    FROM productos p
    INNER JOIN detalles_venta dv ON p.id = dv.producto_id
    INNER JOIN ventas v ON dv.venta_id = v.id
    WHERE v.estado = 'Completada'
      AND v.fecha_venta >= CURRENT_DATE - (p_meses_historia || ' months')::INTERVAL
    GROUP BY p.id, p.nombre
    HAVING SUM(dv.cantidad * dv.precio_unitario) > 0
    ORDER BY total DESC
    LIMIT p_limite;
END;
$$;


