--

CREATE FUNCTION public.update_last_access() RETURNS json
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  v_user_id uuid;
  v_result json;
BEGIN
  v_user_id := auth.uid();
  
  IF v_user_id IS NULL THEN
    RETURN json_build_object('success', false, 'error', 'Usuario no autenticado');
  END IF;
  
  UPDATE public.usuarios 
  SET 
    ultimo_acceso = now(),
    fecha_modificacion = now(),
    modificado_por = v_user_id
  WHERE id = v_user_id;
  
  IF FOUND THEN
    SELECT json_build_object(
      'success', true,
      'data', json_build_object(
        'id', id,
        'ultimo_acceso', ultimo_acceso,
        'fecha_modificacion', fecha_modificacion
      )
    ) INTO v_result
    FROM public.usuarios 
    WHERE id = v_user_id;
    
    RETURN v_result;
  ELSE
    RETURN json_build_object('success', false, 'error', 'No se pudo actualizar el último acceso');
  END IF;
  
EXCEPTION
  WHEN OTHERS THEN
    RETURN json_build_object('success', false, 'error', 'Error interno: ' || SQLERRM);
END;
$$;


