--
-- Name: update_user_profile(character varying, character varying, character varying, character varying, text, character varying, character varying, uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.update_user_profile(p_nombre character varying, p_apellido character varying, p_departamento character varying, p_telefono character varying DEFAULT NULL::character varying, p_biografia text DEFAULT NULL::text, p_cedula character varying DEFAULT NULL::character varying, p_puesto character varying DEFAULT NULL::character varying, p_rol_id uuid DEFAULT NULL::uuid) RETURNS json
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  v_user_id uuid;
  v_result json;
BEGIN
  -- Obtener el ID del usuario autenticado
  v_user_id := auth.uid();
  
  -- Verificar que el usuario esté autenticado
  IF v_user_id IS NULL THEN
    RETURN json_build_object(
      'success', false,
      'error', 'Usuario no autenticado'
    );
  END IF;
  
  -- Verificar que el usuario existe en la tabla usuarios
  IF NOT EXISTS (SELECT 1 FROM public.usuarios WHERE id = v_user_id) THEN
    RETURN json_build_object(
      'success', false,
      'error', 'Usuario no encontrado en la base de datos'
    );
  END IF;
  
  -- Verificar que el rol existe (si se proporciona)
  IF p_rol_id IS NOT NULL AND NOT EXISTS (SELECT 1 FROM public.roles WHERE id = p_rol_id) THEN
    RETURN json_build_object(
      'success', false,
      'error', 'Rol no encontrado'
    );
  END IF;
  
  -- Actualizar el perfil del usuario
  UPDATE public.usuarios 
  SET 
    nombre = p_nombre,
    apellido = p_apellido,
    telefono = p_telefono,
    biografia = p_biografia,
    cedula = p_cedula,
    departamento = p_departamento,
    puesto = p_puesto,
    rol_id = p_rol_id,  -- ✅ Corregido: agregado rol_id
    fecha_modificacion = now(),
    modificado_por = v_user_id
  WHERE id = v_user_id;
  
  -- Verificar que la actualización fue exitosa
  IF FOUND THEN
    -- Obtener los datos actualizados
    SELECT json_build_object(
      'success', true,
      'data', json_build_object(
        'id', id,
        'nombre', nombre,
        'apellido', apellido,
        'email', email,
        'telefono', telefono,
        'biografia', biografia,
        'cedula', cedula,
        'puesto', puesto,
        'departamento', departamento,
        'rol_id', rol_id, 
        'estado', estado,
        'fecha_modificacion', fecha_modificacion
      )
    ) INTO v_result
    FROM public.usuarios 
    WHERE id = v_user_id;
    
    RETURN v_result;
  ELSE
    RETURN json_build_object(
      'success', false,
      'error', 'No se pudo actualizar el perfil'
    );
  END IF;
  
EXCEPTION
  WHEN OTHERS THEN
    RETURN json_build_object(
      'success', false,
      'error', 'Error interno: ' || SQLERRM
    );
END;
$$;


