--
-- Name: vista_desviaciones_recientes; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vista_desviaciones_recientes AS
 SELECT p.id,
    p.tipo_prediccion,
    p.periodo,
    p.fecha_inicio,
    p.fecha_fin,
    COALESCE(i.nombre, (pr.nombre)::character varying, 'Ingresos Totales'::character varying) AS nombre_item,
    COALESCE(i.unidad_medida, (
        CASE
            WHEN ((p.tipo_prediccion)::text = 'ingresos'::text) THEN 'CRC'::text
            ELSE 'unidades'::text
        END)::character varying) AS unidad,
    p.valor_predicho,
    p.valor_real,
    p.desviacion,
    p.porcentaje_desviacion,
    p.nivel_confianza,
    p.algoritmo,
        CASE
            WHEN (p.porcentaje_desviacion IS NULL) THEN 'sin_evaluar'::text
            WHEN (abs(p.porcentaje_desviacion) <= (10)::numeric) THEN 'excelente'::text
            WHEN (abs(p.porcentaje_desviacion) <= (20)::numeric) THEN 'bueno'::text
            WHEN (abs(p.porcentaje_desviacion) <= (30)::numeric) THEN 'aceptable'::text
            ELSE 'revisar'::text
        END AS calificacion_precision
   FROM ((public.predicciones p
     LEFT JOIN public.insumos i ON ((i.id = p.insumo_id)))
     LEFT JOIN public.productos pr ON ((pr.id = p.producto_id)))
  ORDER BY p.fecha_fin DESC;


